def character_encode(ch):
    # ascii字符
    if(ord(ch) < 256):
        return [255,255,ord(ch)-32]
    py = pinyin(ch, style=Style.NORMAL)[0][0]  # 返回该字任意一个拼音
    if pinyin(ch, style=Style.FINALS) == [[""]]:  # 排除"兙"等字
        return [255,255,255]
    # 无声母
    if py[0] in "aoeiuv":
        initial = ""
        final = py
    elif py[0:2] in "zhchsh":
        initial = py[0:2]
        final = py[2:]
    else:
        initial = py[0]
        final = py[1:]
    # 替换
    if final == "ve":
        final = "ue"
    if final == "vn":
        final = "un"
    c0 = initial_list.index(initial)
    c1 = final_list.index(final)
    index = c0 * 33 + c1
    c2 = chs[index].index(ch)
    return [c0, c1, c2]

def str_encode(str):
    ret = []
    for ch in str:
        ret = ret + character_encode(ch)
    return ret

